import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../utils/api";
import "./mytests.css";

export default function MyTests() {
  const [tests, setTests] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchTests = async () => {
      try {
        const { data } = await api.get("/student/tests");
        setTests(data);
      } catch (err) {
        console.error("Failed to fetch tests:", err);
      }
    };
    fetchTests();
  }, []);

  const takeTest = (test) => {
    navigate(`/take-test/${test._id}`, { state: { test } });
  };

  const colors = ["#fef3c7", "#d1fae5", "#dbeafe", "#f0e6ff"];

  return (
    <div className="tests-container">
      <h1>Available Tests</h1>
      <div className="tests-grid">
        {tests.length === 0 && <p>No tests available at the moment.</p>}
        {tests.map((test, index) => (
          <div
            key={test._id}
            className="test-card"
            style={{ backgroundColor: colors[index % colors.length] }}
          >
            <h2>{test.name}</h2>
            <p><strong>Max Marks:</strong> {test.totalMarks}</p>
            <p><strong>Duration:</strong> {test.duration} min</p>
            <button className="take-test-btn" onClick={() => takeTest(test)}>
              Take Test
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
